window.bookSummaryJSON = "<p>Someone is spreading rumors around Deadwood that Violet Parker likes to chat with dead folks.</p> <p>With her reputation endangered, her bank account on the verge of extinction, and her career at risk of going up in flames, Violet is desperate. When the opportunity to sell another vintage home materializes, she grabs it, even though this \"haunted\" house was recently the stage for a two-act murder-suicide tragedy.</p> <p>Ghost or no ghost, Violet knows this can't be as bad as the last house of horrors she tried to sell, but sexy Doc Nyce has serious doubts. Her only hope of hanging on to her job is to prove that the so-called ghostly sightings are merely the eccentric owner's optical delusions.</p> <p>But someone - or something - in the house wants Violet stopped…dead.</p>"; 
